use db_teach_service;
-- 地区联动信息表
drop table tb_area_info;

create table tb_area_info
(
  aiid integer auto_increment primary key not null comment '主键',
  level integer not null comment '区域等级',
  name varchar(255) not null comment '名称',
  pid integer not null comment '上级区域编号',
  aid integer not null comment '区域编号',
  sort integer not null comment '排序编号',
  label varchar(255) not null comment '标签'
)comment '区域信息表';


select * from tb_area_info;